import path from 'path';

export default async function(page, fileUrl, screenshotsDir) {
  try {
    // Navigate to the HTML file
    await page.goto(fileUrl);
    await page.waitForLoadState('networkidle');

    // Take initial screenshot
    const screenshots = [];
    await page.screenshot({ path: path.join(screenshotsDir, 'step_1_initial.png') });
    screenshots.push(path.join(screenshotsDir, 'step_1_initial.png'));

    // Your automation logic here
    // Find a product card to click. We'll target one containing "Sony" to be specific.
    const productCardLocator = page.locator('.product-card', { hasText: 'Sony WH-1000XM5' });
    await productCardLocator.waitFor({ state: 'visible', timeout: 5000 });

    // Click the product card to open the modal
    await productCardLocator.click();
    await page.screenshot({ path: path.join(screenshotsDir, 'step_2_after_click.png') });
    screenshots.push(path.join(screenshotsDir, 'step_2_after_click.png'));

    // Wait for the modal to be visible
    const modalLocator = page.locator('.modal-content');
    await modalLocator.waitFor({ state: 'visible', timeout: 5000 });

    await page.screenshot({ path: path.join(screenshotsDir, 'step_3_modal_visible.png') });
    screenshots.push(path.join(screenshotsDir, 'step_3_modal_visible.png'));

    // Extract data from the modal to verify
    const modalTitleLocator = modalLocator.locator('.product-detail-title');
    const modalTitle = await modalTitleLocator.textContent();

    const modalPriceLocator = modalLocator.locator('.product-detail-price');
    const modalPrice = await modalPriceLocator.textContent();

    return {
      success: true,
      action: "Opened the product detail modal for a specific product.",
      extractedData: {
        productTitleInModal: modalTitle.trim(),
        productPriceInModal: modalPrice.trim()
      },
      screenshots,
      error: null
    };
  } catch (error) {
    return {
      success: false,
      action: "Failed to open product detail modal",
      extractedData: {},
      screenshots: [],
      error: error.message
    };
  }
}
